import { TestBed } from '@angular/core/testing';
import {
  HttpClientTestingModule,
  HttpTestingController,
} from '@angular/common/http/testing';
import { SendImageService } from './send-image.service';
import { HttpClient } from '@angular/common/http';
import { environment } from 'src/environments/environment';

describe('SendImageService', () => {
  let service: SendImageService;
  let httpMock: HttpTestingController;

  beforeEach(() => {
    TestBed.configureTestingModule({
      imports: [HttpClientTestingModule],
      providers: [SendImageService, HttpClient],
    });

    service = TestBed.inject(SendImageService);
    httpMock = TestBed.inject(HttpTestingController);
  });

  afterEach(() => {
    httpMock.verify();
  });

  it('should be created', () => {
    expect(service).toBeTruthy();
  });

  it('should send image successfully', () => {
    const mockImage = "data:image/png;base64,"
    const mockBlob = new Blob([mockImage], { type: 'image/jpeg' });
    const mockFormData = new FormData();
    mockFormData.append('file', mockBlob, 'image.jpeg');
    const mockResponse = { prediction: 'mockPrediction' };

    service.sendResult(mockImage).subscribe((response) => {
      expect(response).toEqual(mockResponse); // Adjust the expectation based on your actual API response.
    });

    const url = `${environment.apiURL}/prediction`;
    const req = httpMock.expectOne(url);
    expect(req.request.method).toBe('POST');
    expect(req.request.body.get('file')).toEqual(mockFormData.get('file'));
    req.flush(mockResponse);
  });
});
